mutation MultipleUpload($files: [Upload!]!) {
  multipleUpload(files: $files) {
    __typename
    id
    path
    filename
    mimetype
  }
}

ba01cc6f40a36b96a17826335e7f26b6361525ad.source:
mutation NestedUpload($topFile: Upload, $topFileList: [Upload], $nested: NestedObject) {
  nestedUpload(topFile: $topFile, topFileList: $topFileList, nested: $nested)
}

3f7ac3c0d5e27dd53137ddf46545eab90d831bc6.source:
mutation SingleUpload($file: Upload!) {
  singleUpload(file: $file) {
    __typename
    id
    path
    filename
    mimetype
  }
}

11a4e191e09f459ae8a647e8f23d2798740b2327.source:
mutation SingleUploadTwice($file1: Upload!, $file2: Upload!) {
  file1: singleUpload(file: $file1) {
    __typename
    id
    path
    filename
    mimetype
  }
  file2: singleUpload(file: $file2) {
    __typename
    id
    path
    filename
    mimetype
  }
}
